vec4 rocketColliders(vec3 original, bool player, int monsterType) {
	vec3 newPosition = original;
	float yOriginal = original.y;

	bool onSlide = false;
	bool inRocket = false;

	if (doorRot > 0.0f && doorRot < ROCKET_DOOR_OPEN_ROT && !mainPlayer.insideRocketFixed) {
		if (newPosition.z > rocket.position.z - sin(radians(doorRot)) * ROCKET_DOOR_COLLIDER_LENGTH) {
			if (newPosition.x < rocket.position.x && newPosition.x > rocket.position.x - ROCKET_DOOR_WIDTH - ROCKET_DOOR_Z_COLLIDER_ADDITION) {
				newPosition.x = rocket.position.x - ROCKET_DOOR_WIDTH - ROCKET_DOOR_Z_COLLIDER_ADDITION;
			}
			if (newPosition.x >= rocket.position.x && newPosition.x < rocket.position.x + ROCKET_DOOR_WIDTH + ROCKET_DOOR_Z_COLLIDER_ADDITION) {
				newPosition.x = rocket.position.x + ROCKET_DOOR_WIDTH + ROCKET_DOOR_Z_COLLIDER_ADDITION;
			}
		}
		if (newPosition.x > rocket.position.x - ROCKET_DOOR_WIDTH && newPosition.x < rocket.position.x + ROCKET_DOOR_WIDTH) {
			if (newPosition.z + ROCKET_DOOR_Z_COLLIDER_ADDITION > rocket.position.z - sin(radians(doorRot)) * ROCKET_DOOR_COLLIDER_LENGTH) {
				newPosition.z = rocket.position.z - sin(radians(doorRot)) * ROCKET_DOOR_COLLIDER_LENGTH;
				newPosition.z = newPosition.z - ROCKET_DOOR_Z_COLLIDER_ADDITION;
			}
		}
	}

	if (doorRot == ROCKET_DOOR_OPEN_ROT && !mainPlayer.insideRocketFixed) {
		if (newPosition.z > rocket.position.z - sin(radians(doorRot)) * ROCKET_DOOR_COLLIDER_LENGTH) {
			if (newPosition.x < rocket.position.x - ROCKET_DOOR_WIDTH) {
				if (newPosition.x > rocket.position.x - ROCKET_DOOR_WIDTH - ROCKET_DOOR_Z_COLLIDER_ADDITION) {
					newPosition.x = rocket.position.x - ROCKET_DOOR_WIDTH - ROCKET_DOOR_Z_COLLIDER_ADDITION;
				}
			}
			if (newPosition.x > rocket.position.x + ROCKET_DOOR_WIDTH) {
				if (newPosition.x < rocket.position.x + ROCKET_DOOR_WIDTH + ROCKET_DOOR_Z_COLLIDER_ADDITION) {
					newPosition.x = rocket.position.x + ROCKET_DOOR_WIDTH + ROCKET_DOOR_Z_COLLIDER_ADDITION;
				}
			}

			// y position

			if (newPosition.x > rocket.position.x - ROCKET_DOOR_WIDTH) {
				if (newPosition.x < rocket.position.x + ROCKET_DOOR_WIDTH) {
					float zRocketDoorEndPos = rocket.position.z - sin(radians(doorRot)) * ROCKET_DOOR_COLLIDER_LENGTH;
					float zDistance = glm::distance(newPosition.z, zRocketDoorEndPos);
					float slideEndPos = glm::distance(zRocketDoorEndPos, SLIDE_END_POS_FOR_COLLIDER);
					
					zDistance = glm::clamp(zDistance / slideEndPos, 0.0f, 1.1f);
					onSlide = true;
					
					if (zDistance == 1.1f) {
						inRocket = true;
					}
					newPosition.y = zDistance * SLIDE_TOP_HEIGHT + LEG_LENGTH;
					if (monsterType != -1) { 
						newPosition.y -= LEG_LENGTH;
						if (monsterType == EARTH_TWO) {
							newPosition.y += 4.0f;
						}
					}
				}
			}
		}
	}

	vec2 floor = vec2(original.x, original.z);

	vec2 rocketFloor = vec2(rocket.position.x, rocket.position.z);
	float distance = glm::distance(floor, rocketFloor);

	if (distance < ROCKET_COLLIDER_DISTANCE && !onSlide && !mainPlayer.insideRocketFixed) {
		float bearing = bearingTwo(rocketFloor, floor);
		
		// clamp values so you dont go automatically on the walkway. if i change the colliders distance for main rocket theese will need to be changed as i am a lazy programmer who doesnt want to setup un-hardcoded values
		if (bearing > 154.0f && bearing < 179.5f) {
			bearing = 154.0f;
		}
		if (bearing >= 179.5f && bearing < 206.0f) {
			bearing = 206.0f;
		}
		

		newPosition.x = rocketFloor.x + sin(radians(bearing)) * ROCKET_COLLIDER_DISTANCE;
		newPosition.z = rocketFloor.y + cos(radians(bearing)) * ROCKET_COLLIDER_DISTANCE;
	}

	if (onSlide) {
		if (inRocket) {
			if (newPosition.x < rocket.position.x - 0.4f) {
				newPosition.x = rocket.position.x - 0.4f;
			}
			if (newPosition.x > rocket.position.x + 0.4f) {
				newPosition.x = rocket.position.x + 0.4f;
			}
			if (newPosition.z > rocket.position.z - 0.95f) {
				newPosition.z = rocket.position.z - 0.95f;
			}
		}
	}
	if (player) {
		if (mainPlayer.onRocketSlideLast && !onSlide) {
			mainPlayer.jumpVelocity = 0.0f;
			mainPlayer.jumping = true;
			newPosition.y = yOriginal;
		}
		mainPlayer.onRocketSlideLast = onSlide;
		mainPlayer.inRocket = inRocket;
		if (onSlide || inRocket) {
			if (!mainPlayer.canGoFixed) {
				if (newPosition.z < -1.55f) {
					mainPlayer.canGoFixed = true;
				}
			}
		}
		if (inRocket) {
			if (newPosition.z > -1.55f && mainPlayer.canGoFixed) {
				mainPlayer.insideRocketFixed = true;
			}
		}
		if (mainPlayer.insideRocketFixed) {
			if (newPosition.z < -1.2f) {
				newPosition.z = -1.2f;
			}
			if (newPosition.z > rocket.position.z - 0.95f) {
				newPosition.z = rocket.position.z - 0.95f;
			}
			if (newPosition.x < rocket.position.x - 0.4f) {
				newPosition.x = rocket.position.x - 0.4f;
			}
			if (newPosition.x > rocket.position.x + 0.4f) {
				newPosition.x = rocket.position.x + 0.4f;
			}
			newPosition.y = 1.1f * SLIDE_TOP_HEIGHT + LEG_LENGTH;
		}
	}
	return vec4(newPosition, onSlide);
}

vec3 rocketCameraColliders(vec3 original, vec3 playerPos) {
	vec3 newPosition = original;

	vec2 floor = vec2(original.x, original.z);
	vec2 rocketFloor = vec2(rocket.position.x, rocket.position.z);
	float distance = glm::distance(floor, rocketFloor);
	float worldDistance = glm::distance(rocket.position, newPosition);
	
	if (distance < ROCKET_COLLIDER_DISTANCE && worldDistance < ROCKET_CAMERA_WORLD_DISTANCE) {
		float bearing = bearingTwo(rocketFloor, floor);

		newPosition.x = rocketFloor.x + sin(radians(bearing)) * ROCKET_COLLIDER_DISTANCE;
		newPosition.z = rocketFloor.y + cos(radians(bearing)) * ROCKET_COLLIDER_DISTANCE;
	}

	return newPosition;
}

void openDoorAnimation(float multiplier) {
	doorRot += multiplier * deltaTime;
	doorRot = glm::clamp(doorRot, 0.0f, ROCKET_DOOR_OPEN_ROT);
}

bool openDoorBackup = false;
void openDoor() {
	if (!mainPlayer.insideRocketFixed) {
		float distance = glm::distance(rocket.position, mainPlayer.position);
		if (distance < ROCKET_OPEN_DISTANCE) {
			openDoorAnimation(ROCKET_OPEN_SPEED);
		}
		if (distance > ROCKET_OPEN_DISTANCE) {
			openDoorAnimation(-ROCKET_OPEN_SPEED);
		}
	}
	if (mainPlayer.insideRocketFixed && !openDoorBackup) {
		openDoorAnimation(-ROCKET_OPEN_SPEED * 2.0f);
	}
	if (checkKeyDown(interactKey) && !rocketFlying && mainPlayer.insideRocketFixed) {
		openDoorBackup = true;
	}
	if (openDoorBackup) {
		openDoorAnimation(ROCKET_OPEN_SPEED * 2.0f);
		if (doorRot == ROCKET_DOOR_OPEN_ROT) {
			openDoorBackup = false;
			mainPlayer.insideRocketFixed = false;
			mainPlayer.canGoFixed = false;
		}
	}
}

float rocketDriveDelay = ROCKET_CANNOT_DRIVE_TIME;
void startRocket(){
	if (checkKey(stoi(inputLines[0])) && mainPlayer.insideRocketFixed && doorRot == 0.0f && !rocketFlying) {
		rocketFlying = true;
		rocketDriveDelay = ROCKET_CANNOT_DRIVE_TIME;
	}
}

float rocketSpeed = 0.0f;
float rotateSpeedY = 0.0f;
float rotateSpeedX = 0.0f;

float rocketShootDelay = 0.0f, rocketBulletShootDelay = 0.0f;

float rocketLauncherExplodeTime = ROCKET_EXPLODE_TIME, rocketGunExplodeTime = ROCKET_EXPLODE_TIME, rocketExplodeTime = ROCKET_EXPLODE_TIME;
bool rocketLauncherExploding = false, rocketGunExploding = false, rocketExploding = false;
void rocketExplodingMethod() {
	// setting exploding
	
	// collision locations - very top, end of boosters, top of gun, bottom of gun, middle of gun, end of top launcher, end of bottom launcher

	vector<vec3> collisionLocationsLauncher{
		vec3(-1.3f, -0.2f, 0.0f),
		vec3(-1.3f, 0.2f, 0.0f),

		vec3(-0.65f, 0.2f, 0.0f),
		vec3(-0.65f, -0.2f, 0.0f),
	};

	vector<vec3> collisionLocationsGun{
		vec3(1.025f, 1.1f, 0.0f),
		vec3(1.025f, -0.9f, 0.0f),
		vec3(1.025f, 0.2f, 0.0f)
	};

	vector<vec3> collisionLocationsRocket = {
		// holders
		vec3(0.5f, -1.5f, 0.5f),
		vec3(-0.5f, -1.5f, 0.5f),
		vec3(-0.5f, -1.5f, -0.5f),
		vec3(0.5f, -1.5f, -0.5f),
		// top of rocket
		vec3(0.0f, 3.0f, 0.0f),
		// top sides 
		vec3(0.0f, 1.5f, 0.6f),
		vec3(0.0f, 1.5f, -0.6f),
		vec3(-0.6f, 1.5f, 0.0f),
		vec3(0.6f, 1.5f, 0.0f)
	};
	mat4 explodingMatrix = modelMatrix(vec3(0.0f), vec3(0.0f), rocket.scale, true, rocket.position, rocket.rotation);
	if (!rocketLauncherExploding) {
		for (vec3 launcherCollide : collisionLocationsLauncher) {
			vec3 original = vec3(explodingMatrix * vec4(launcherCollide, 1.0f));
			vec3 start = original;

			vec3 terrain = vec3(terrainColliders(start, 0.0f));
			if (start.y < terrain.y) { start.y = terrain.y; }
			buildCollisions(start, emptyInt, emptyFloat, emptyBool, emptyBoolTwo, 0.0f);

			if (start == original) {
				continue;
			}

			rocketLauncherExploding = true;
		}
	}

	if (!rocketGunExploding) {
		for (vec3 bulletCollide : collisionLocationsGun) {
			vec3 original = vec3(explodingMatrix * vec4(bulletCollide, 1.0f));
			vec3 start = original;

			vec3 terrain = vec3(terrainColliders(start, 0.0f));
			if (start.y < terrain.y) { start.y = terrain.y; }
			buildCollisions(start, emptyInt, emptyFloat, emptyBool, emptyBoolTwo, 0.0f);

			if (start == original) {
				continue;
			}

			rocketGunExploding = true;
		}
	}

	if (!rocketExploding) {
		for (vec3 rocketCollide : collisionLocationsRocket) {
			vec3 original = vec3(explodingMatrix * vec4(rocketCollide, 1.0f));
			vec3 start = original;

			vec3 terrain = vec3(terrainColliders(start, 0.0f));
			if (start.y < terrain.y) { start.y = terrain.y; }
			buildCollisions(start, emptyInt, emptyFloat, emptyBool, emptyBoolTwo, 0.0f);

			if (start == original) {
				continue;
			}

			rocketExploding = true;
			rocketGunExploding = true;
			rocketLauncherExploding = true;
		}
	}

	// actual exploding
	if (rocketLauncherExploding && rocketLauncherExplodeTime > 0.0f) {
		vec4 position = vec4(-1.0f, 0.0f, 0.0f, 1.0f);
		position = modelMatrix(vec3(0.0f), vec3(0.0f), rocket.scale, true, rocket.position, rocket.rotation) * position;
		vec3 createPos = vec3(position);

		for (int x = 0; x < 360.0f / ROCKET_EXPLODE_QUALITY; x++) {
			for (int y = 0; y < 360.0f / ROCKET_EXPLODE_QUALITY; y++) {
				vec3 rotation = vec3(0.0f);
				rotation.x = (float)x * ROCKET_EXPLODE_QUALITY;
				rotation.y = (float)y * ROCKET_EXPLODE_QUALITY;

				int newParticle = createParticle(createPos, rotation, false);
				allParticles[newParticle].speed = 3.0f;
			}
		}
		rocketLauncherGun.scale = glm::clamp(rocketLauncherGun.scale - vec3(deltaTime), 0.0f, 100.0f);
		rocketLauncherExplodeTime -= deltaTime;
	}
	if (rocketGunExploding && rocketGunExplodeTime > 0.0f) {
		vec4 position = vec4(1.0125f, 0.0f, 0.0f, 1.0f);
		position = modelMatrix(vec3(0.0f), vec3(0.0f), rocket.scale, true, rocket.position, rocket.rotation) * position;
		vec3 createPos = vec3(position);

		for (int x = 0; x < 360.0f / ROCKET_EXPLODE_QUALITY; x++) {
			for (int y = 0; y < 360.0f / ROCKET_EXPLODE_QUALITY; y++) {
				vec3 rotation = vec3(0.0f);
				rotation.x = (float)x * ROCKET_EXPLODE_QUALITY;
				rotation.y = (float)y * ROCKET_EXPLODE_QUALITY;

				int newParticle = createParticle(createPos, rotation, false);
				allParticles[newParticle].speed = 3.0f;
			}
		}
		rocketGun.scale = glm::clamp(rocketGun.scale - vec3(deltaTime), 0.0f, 100.0f);
		rocketGunExplodeTime -= deltaTime;
	}
	if (rocketExploding && rocketExplodeTime > 0.0f) {
		for (int x = 0; x < 360.0f / ROCKET_EXPLODE_QUALITY; x++) {
			for (int y = 0; y < 360.0f / ROCKET_EXPLODE_QUALITY; y++) {
				vec3 rotation = vec3(0.0f);
				rotation.x = (float)x * ROCKET_EXPLODE_QUALITY;
				rotation.y = (float)y * ROCKET_EXPLODE_QUALITY;

				createParticle(rocket.position, rotation, false);
			}
		}
		rocket.scale = glm::clamp(rocket.scale - vec3(deltaTime * 1.6f), vec3(0.0f), vec3(100.0f));
		vec3 statusMinus= vec3(deltaTime) * vec3(0.65f, 0.9f, 2.5f);
		rocketStatusScale = glm::clamp(rocketStatusScale - statusMinus, vec3(0.0f), vec3(1000.0f));

		rocketExplodeTime -= deltaTime;
		if (rocketExplodeTime < 0.0f) {
			rocketLauncherExploding = true;
			rocketGunExploding = true;
		}
	}
}

void flyRocket() {
	if (!rocketFlying) {
		return;
	}
	vec3 direction = vec3(0.0f);
	direction.x = sin(radians(rocket.rotation.y)) * sin(radians(rocket.rotation.x));
	direction.y = cos(radians(rocket.rotation.x));
	direction.z = cos(radians(rocket.rotation.y)) * sin(radians(rocket.rotation.x));

	direction = direction * vec3(deltaTime);
	direction = direction * vec3(rocketSpeed);

	if(!rocketExploding){ rocket.position = rocket.position + direction; }
	mainPlayer.position = rocket.position;
	mainPlayer.rotation = rocket.rotation;

	rocketSpeed += deltaTime * ROCKET_SPEED_INCREASE;
	rocketSpeed = glm::clamp(rocketSpeed, 0.0f, ROCKET_SPEED_MAX);

	holderRot = glm::clamp(holderRot + deltaTime * HOLDER_ROTATION_MULTIPLIER, 0.0f, 140.0f);

	float speed = glm::distance(WEAPON_GUN_MIN_X, WEAPON_GUN_MAX_X) * WEAPON_LAUNCH_MULTIPLIER;
	rocketGun.position.x = glm::clamp(rocketGun.position.x + deltaTime * speed, WEAPON_GUN_MIN_X, WEAPON_GUN_MAX_X);

	speed = glm::distance(WEAPON_ROCKET_LAUNCHER_MIN_X, WEAPON_ROCKET_LAUNCHER_MAX_X) * WEAPON_LAUNCH_MULTIPLIER;
	rocketLauncherGun.position.x = glm::clamp(rocketLauncherGun.position.x - deltaTime * speed, WEAPON_ROCKET_LAUNCHER_MIN_X, WEAPON_ROCKET_LAUNCHER_MAX_X);

	rocketDriveDelay -= deltaTime;
	if (rocketDriveDelay > 0.0f || rocketExploding) {
		return;
	}

	int forwardKey = stoi(inputLines[0]);
	int leftKey = stoi(inputLines[1]);
	int backKey = stoi(inputLines[2]);
	int rightKey = stoi(inputLines[3]);

	bool changedForward = false;
	bool changedRight = false;

	if (checkKey(forwardKey) && !checkKey(backKey)) {
		rotateSpeedX -= deltaTime * ROCKET_ROTATE_SPEED_INCREASE;
		changedForward = true;
	}
	if (checkKey(leftKey) && !checkKey(rightKey)) {
		rotateSpeedY += deltaTime * ROCKET_ROTATE_SPEED_INCREASE;
		changedRight = true;
	}
	if (checkKey(backKey) && !checkKey(forwardKey)) {
		rotateSpeedX += deltaTime * ROCKET_ROTATE_SPEED_INCREASE;
		changedForward = true;
	}
	if (checkKey(rightKey) && !checkKey(leftKey)) {
		rotateSpeedY -= deltaTime * ROCKET_ROTATE_SPEED_INCREASE;
		changedRight = true;
	}

	if (!changedForward) {
		if (rotateSpeedX > 0.0f) {
			rotateSpeedX -= deltaTime * ROCKET_ROTATE_SPEED_INCREASE * ROTATION_DECREASE_MULTIPLIER;
		}
		if (rotateSpeedX < 0.0f) {
			rotateSpeedX += deltaTime * ROCKET_ROTATE_SPEED_INCREASE * ROTATION_DECREASE_MULTIPLIER;
		}
		if (glm::distance(rotateSpeedX, 0.0f) < ROCKET_ROTATION_CUTOFF) {
			rotateSpeedX = 0.0f;
		}
	}

	if (!changedRight) {
		if (rotateSpeedY > 0.0f) {
			rotateSpeedY -= deltaTime * ROCKET_ROTATE_SPEED_INCREASE * ROTATION_DECREASE_MULTIPLIER;
		}
		if (rotateSpeedY < 0.0f) {
			rotateSpeedY += deltaTime * ROCKET_ROTATE_SPEED_INCREASE * ROTATION_DECREASE_MULTIPLIER;
		}
		if (glm::distance(rotateSpeedY, 0.0f) < ROCKET_ROTATION_CUTOFF) {
			rotateSpeedY = 0.0f;
		}
	}

	rotateSpeedX = glm::clamp(rotateSpeedX, -ROCKET_MAX_ROTATE_SPEED, ROCKET_MAX_ROTATE_SPEED);
	rotateSpeedY = glm::clamp(rotateSpeedY, -ROCKET_MAX_ROTATE_SPEED, ROCKET_MAX_ROTATE_SPEED);

	rocket.rotation.x += deltaTime * rotateSpeedX;
	rocket.rotation.y += deltaTime * rotateSpeedY;

	if (checkKeyDown(shootButton) && rocketShootDelay < 0.0f && !rocketLauncherExploding) {
		createRocketLauncherBullet();
		rocketShootDelay = ROCKET_LAUNCHER_SHOOT_DELAY;
	}

	if (checkKey(aimButton) && rocketBulletShootDelay < 0.0f && !rocketGunExploding) {
		createRocketGunBullet();
		rocketBulletShootDelay = ROCKET_GUN_BULLET_DELLAY;
	}

	rocketBulletShootDelay -= deltaTime;
	rocketShootDelay -= deltaTime;
}

vector<string> saveRocket(vector<string> current){
	vector<string> original = current;

	string rocketPosLine = to_string(rocket.position.x) + " " + to_string(rocket.position.y) + " " + to_string(rocket.position.z);
	original = rewriteLine(original, "rocketPos", rocketPosLine);

	string rocketRotLine = to_string(rocket.rotation.x) + " " + to_string(rocket.rotation.y) + " " + to_string(rocket.rotation.z);
	original = rewriteLine(original, "rocketRot", rocketRotLine);

	return original;
}

vec3 rocketStatusScale = vec3(1.3f, 1.8f, 5.0f);
void renderRocket() {
	glUseProgram(playerShader);
	rocketExplodingMethod();
	bool inWater = false;
	if (cameraThirdPos.y <= 0.05f) {
		int index = (int)terrainColliders(cameraThirdPos, 0.0f).w;
		index = index - 1;
		if (index > -1) {
			inWater = currentAllMountainWaters[index];
		}
	}
	setMat4(playerShader, "model", modelMatrix(rocket.position, rocket.rotation, rocket.scale));
	setMat4(playerShader, "projection", projectionMatrix());
	setMat4(playerShader, "view", viewMatrix());

	setShaderInt(playerShader, "cameraInWater", inWater);
	setShaderVecThree(playerShader, "waterMultiplyColour", WorldGeneration.waterMultiplyColour);

	setShaderVecThree(playerShader, "multiplyColour", vec3(1.0f));
	setShaderVecThree(playerShader, "lightPos", lightPos);
	setShaderFloat(playerShader, "lightIntensity", lightIntensity);
	setShaderFloat(playerShader, "lightRadius", lightRadius);
	setShaderInt(playerShader, "useLight", 1);
	setShaderFloat(playerShader, "lowestLight", lowestLight);

	glBindVertexArray(rocket.VAO);
	glDrawArrays(GL_TRIANGLES, 0, rocket.size);

	rocketLauncherGun.position.x = glm::clamp(rocketLauncherGun.position.x, WEAPON_ROCKET_LAUNCHER_MIN_X, WEAPON_ROCKET_LAUNCHER_MAX_X);
	if (rocketFlying) {
		vec3 gunPos = rocketGun.position;
		gunPos = gunPos * (rocket.scale / vec3(4.0f));

		setMat4(playerShader, "model", modelMatrix(gunPos, rocketGun.rotation, 
			rocketGun.scale, true, rocket.position, rocket.rotation, true));
		glBindVertexArray(rocketGun.VAO);
		glDrawArrays(GL_TRIANGLES, 0, rocketGun.size);

		vec3 launcherPos = rocketLauncherGun.position;
		launcherPos = launcherPos * (rocket.scale / vec3(4.0f));

		setMat4(playerShader, "model", modelMatrix(launcherPos, rocketLauncherGun.rotation, 
			rocketLauncherGun.scale, true, rocket.position, rocket.rotation, true));
		glBindVertexArray(rocketLauncherGun.VAO);
		glDrawArrays(GL_TRIANGLES, 0, rocketLauncherGun.size);
	}

	int rCount = allRocketLauncherBullets.size();
	glBindVertexArray(rocketLauncherBullet.VAO);
	for (int r = 0; r < rCount; r++) {
		allRocketLauncherBullets[r].mainloop();
	}

	setShaderVecThree(playerShader, "multiplyColour", vec3(0.4f));
	int bCount = allRocketGunBullets.size();
	glBindVertexArray(rocketGunBullet.VAO);
	for (int b = 0; b < bCount; b++) {
		allRocketGunBullets[b].mainloop();
	}

	vec3 mainPos = vec3(WorldGeneration.currentAreaScale.x / 2.0f, 0.0f, 0.0f);
	vec3 holderPositions[] = { vec3(-3.25f, 0.0f, 0.0f), vec3(3.25f, 0.0f, 0.0f), vec3(0.0f, 0.0f, 3.25f), vec3(0.0f, 0.0f, -3.25f) };
	vec3 rocketRotations[] = { vec3(0.0f, 0.0f, 0.0f), vec3(0.0f, 180.0f, 0.0f), vec3(0.0f, 90.0f, 0.0f), vec3(0.0f, 270.0f, 0.0f) };
	vec3 rocketParentRots[] = { vec3(0.0f, 0.0f, holderRot), vec3(0.0f, 0.0f, -holderRot), vec3(holderRot, 0.0f, 0.0f), vec3(-holderRot, 0.0f, 0.0f) };
	
	setShaderVecThree(playerShader, "multiplyColour", vec3(1.0f));
	for (int h = 0; h < 4; h++) {
		vec3 parentPos = mainPos + holderPositions[h];

		setMat4(playerShader, "model", modelMatrix(vec3(0.0f, 3.1f, 0.0f), rocketRotations[h], 
			vec3(4.0f), true, parentPos, rocketParentRots[h], true));
		glBindVertexArray(rocketHolder.VAO);
		glDrawArrays(GL_TRIANGLES, 0, rocketHolder.size);
	}

	glLinkProgram(playerShader);

	vec3 statusPos = vec3(0.0f, 4.1f, -2.475f);
	statusPos = statusPos * vec3(1.0f, rocketStatusScale.y / 1.8f, rocketStatusScale.z / 5.0f);

	rocketStatus.render(modelMatrix(statusPos, vec3(doorRot, 0.0f, 0.0f), rocketStatusScale, true, rocket.position, rocket.rotation + vec3(0.0f, 0.0f, 180.0f), true),
		true, vec3(1.0f), inWater, WorldGeneration.waterMultiplyColour);

}

void rocketMainloop() {
	if (!WorldGeneration.startedBegin) {
		return;
	}
	renderRocket();
	openDoor();
	fireMainloop();
	spawnParticles();
	startRocket();
	flyRocket();
}

