void fireMainloop() {
	glEnable(GL_CULL_FACE);
	glCullFace(GL_BACK);

	glUseProgram(playerShader);
	glBindVertexArray(flameCube.VAO);

	setMat4(playerShader, "view", viewMatrix());
	setMat4(playerShader, "projection", projectionMatrix());

	setShaderVecThree(playerShader, "lightPos", lightPos);
	setShaderFloat(playerShader, "lightIntensity", lightIntensity);
	setShaderFloat(playerShader, "lightRadius", lightRadius);
	setShaderInt(playerShader, "useLight", 0);
	setShaderFloat(playerShader, "lowestLight", lowestLight);

	int count = allParticles.size();
	for (int i = 0; i < count; i++) {
		if (!allParticles[i].active) {
			continue;
		}

		allParticles[i].move();
		allParticles[i].render();

		allParticles[i].lifetimeLeft -= deltaTime * allParticles[i].dyingSpeed;
		if (allParticles[i].lifetimeLeft < 0.0f) {
			allParticles[i].active = false;
		}
	}

	glLinkProgram(playerShader);
	glDisable(GL_CULL_FACE);
}

void fireParticle::move() {
	vec3 direction = vec3(0.0f);
	direction.x = cos(radians(rotation.y)) * cos(radians(rotation.x));
	direction.y = sin(radians(rotation.x));
	direction.z = -sin(radians(rotation.y)) * cos(radians(rotation.x));

	direction = direction * deltaTime;
	direction = direction * speed;

	position = position + direction;
	rotation.z += deltaTime * speed;
}

void fireParticle::render() {
	setMat4(playerShader, "model", modelMatrix(position, rotation, scale));
	setShaderFloat(playerShader, "alpha", lifetimeLeft);
	setShaderVecThree(playerShader, "multiplyColour", colour);	
	glDrawArrays(GL_TRIANGLES, 0, flameCube.size);
}

int createParticle(vec3 position, vec3 rotation, bool rocket) {
	fireParticle newParticle;
	newParticle.position = position;

	vec3 usedRotation = rotation;
	usedRotation.x += randomInt(0, (int) FIRE_ROT_RANDOMNESS) - (FIRE_ROT_RANDOMNESS / 2.0f);
	usedRotation.y += randomInt(0, (int) FIRE_ROT_RANDOMNESS) - (FIRE_ROT_RANDOMNESS / 2.0f);
	newParticle.rotation = usedRotation;

	int colourType = randomInt(1, 3);
	vector<vec3> allFireColours = { vec3(1.0f, 0.0f, 0.0f), vec3(0.92f, 0.9f, 0.0f), vec3(0.92f, 0.341f, 0.0f)};
	
	vec3 chosenColour = allFireColours[colourType - 1];
	vec3 usedColour = vec3(0.0f, chosenColour.y, 0.0f);

	if (rocket) {
		usedColour.x = (rocketSpeed / ROCKET_SPEED_MAX) * chosenColour.x;
		usedColour.z = ((ROCKET_SPEED_MAX - rocketSpeed) / ROCKET_SPEED_MAX) * chosenColour.x;
	}
	if (!rocket) { usedColour = chosenColour; }
	
	newParticle.colour = usedColour;

	int vectorSize = allParticles.size();
	allParticles[newVectorPos(&allParticles)] = newParticle;
	return vectorSize;
}

void spawnParticles() {
	if (!rocketFlying || rocketExploding) {
		return;
	}
	vector<vec3> positions = {
		vec3(0.5f, -1.5f, 0.5f),
		vec3(-0.5f, -1.5f, 0.5f),
		vec3(-0.5f, -1.5f, -0.5f),
		vec3(0.5f, -1.5f, -0.5f),

		vec3(0.0f, -1.2f, -0.25f),
		vec3(0.0f, -1.2f, 0.25f)
	};

	for (int p = 0; p < 6; p++) {
		vec4 position = vec4(positions[p], 1.0f);
		position = modelMatrix(vec3(0.0f), vec3(0.0f), rocket.scale, true, rocket.position, rocket.rotation) * position;

		if (randomInt(1, FIRE_SPAWN_RATE) == 1) {
			createParticle(vec3(position), rocket.rotation + vec3(-90.0f, 90.0f, 0.0f));
		}
	}

}

vector<rocketLauncherBulletIndividual> allRocketLauncherBullets;
vector<rocketGunBulletIndividual> allRocketGunBullets;
int createRocketLauncherBullet() {
	rocketLauncherBulletIndividual newBullet;
	newBullet.begin();

	allRocketLauncherBullets[newVectorPos(&allRocketLauncherBullets)] = newBullet;
	int size = allRocketLauncherBullets.size();

	return size - 1;
}

void rocketLauncherBulletIndividual::begin() {
	vec4 positionBullet = vec4(-1.0f, 0.5f, 0.0f, 1.0f);
	
	positionBullet = modelMatrix(vec3(0.0f), vec3(0.0f), rocket.scale, true, rocket.position, rocket.rotation) * positionBullet;
	position = vec3(positionBullet);

	rotation = rocket.rotation + vec3(180.0f, 0.0f, 0.0f);
}

void rocketLauncherBulletIndividual::mainloop() {
	if (!active) { return; }
	lifetime -= deltaTime;
	if (explodeTime < 0.0f) {
		active = false;
		return;
	}
	if (lifetime < 0.0f) {
		explode();
		return;
	}
	move();
	render();
}

void rocketLauncherBulletIndividual::move() {
	vec3 direction = vec3(0.0f);
	direction.x = sin(radians(rotation.y)) * sin(radians(rotation.x - 180.0f));
	direction.y = cos(radians(rotation.x - 180.0f));
	direction.z = cos(radians(rotation.y)) * sin(radians(rotation.x - 180.0f));

	direction = direction * vec3(deltaTime);
	direction = direction * vec3(rocketSpeed + ROCKET_LAUNCHER_BULLET_SPEED);

	position = position + direction;

	if (randomInt(1, FIRE_SPAWN_RATE) == 1) {
		vec4 startPos = vec4(vec3(0.0f, 1.4f, 0.0f), 1.0f);
		startPos = modelMatrix(position, rotation, rocketLauncherBullet.scale) * startPos;
		
		createParticle(vec3(startPos), rotation + vec3(90.0f, -90.0f, 0.0f), false);
	}
}

void rocketLauncherBulletIndividual::explode() {
	for (int x = 0; x <= 360 / ROCKET_LAUNCHER_BULLET_QUALITY; x++) {
		for (int y = 0; y <= 360 / ROCKET_LAUNCHER_BULLET_QUALITY; y++) {
			vec3 rotation = vec3(0.0f);
			rotation.x = (float) x * ROCKET_LAUNCHER_BULLET_QUALITY;
			rotation.y = (float) y * ROCKET_LAUNCHER_BULLET_QUALITY;

			createParticle(position, rotation, false);
		}
	}

	explodeTime -= deltaTime;
}

void rocketLauncherBulletIndividual::render() {
	setMat4(playerShader, "model", modelMatrix(position, rotation, rocketLauncherBullet.scale));
	glDrawArrays(GL_TRIANGLES, 0, rocketLauncherBullet.size);
}

int createRocketGunBullet() {
	rocketGunBulletIndividual newBullet;
	newBullet.begin();

	allRocketGunBullets[newVectorPos(&allRocketGunBullets)] = newBullet;
	int size = allRocketGunBullets.size();

	return size - 1;
}

void rocketGunBulletIndividual::begin() {
	vec4 positionBullet = vec4(1.0125f, 1.1f, 0.0f, 1.0f);

	positionBullet = modelMatrix(vec3(0.0f), vec3(0.0f), rocket.scale, true, rocket.position, rocket.rotation) * positionBullet;
	position = vec3(positionBullet);

	rotation = rocket.rotation + vec3(180.0f, 0.0f, 0.0f);
}

void rocketGunBulletIndividual::mainloop() {
	if (!active) { return; }

	move();
	render();
}

void rocketGunBulletIndividual::render() {
	setMat4(playerShader, "model", modelMatrix(position, rotation, rocketGunBullet.scale));
	glDrawArrays(GL_TRIANGLES, 0, rocketLauncherBullet.size);
}

void rocketGunBulletIndividual::move() {
	vec3 direction = vec3(0.0f);
	direction.x = sin(radians(rotation.y)) * sin(radians(rotation.x - 180.0f));
	direction.y = cos(radians(rotation.x - 180.0f));
	direction.z = cos(radians(rotation.y)) * sin(radians(rotation.x - 180.0f));

	direction = direction * vec3(deltaTime);
	direction = direction * vec3(rocketSpeed + ROCKET_GUN_BULLET_SPEED);

	position = position + direction;
}